public class InnerJobProfileConfigurationFactory(Action<Humidifier.DataBrew.JobTypes.ProfileConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.DataBrew.JobTypes.ProfileConfiguration>
{

    internal InnerJobStatisticsConfigurationFactory DatasetStatisticsConfigurationFactory { get; set; }

    internal InnerJobEntityDetectorConfigurationFactory EntityDetectorConfigurationFactory { get; set; }

    protected override Humidifier.DataBrew.JobTypes.ProfileConfiguration Create()
    {
        var profileConfigurationResult = CreateProfileConfiguration();
        factoryAction?.Invoke(profileConfigurationResult);

        return profileConfigurationResult;
    }

    private Humidifier.DataBrew.JobTypes.ProfileConfiguration CreateProfileConfiguration()
    {
        var profileConfigurationResult = new Humidifier.DataBrew.JobTypes.ProfileConfiguration();

        return profileConfigurationResult;
    }
    public override void CreateChildren(Humidifier.DataBrew.JobTypes.ProfileConfiguration result)
    {
        base.CreateChildren(result);

        result.DatasetStatisticsConfiguration ??= DatasetStatisticsConfigurationFactory?.Build();
        result.EntityDetectorConfiguration ??= EntityDetectorConfigurationFactory?.Build();
    }

} // End Of Class

